import React from 'react';
import './App.css';
import { Button, Slider, Container, Header, Text } from './StyledComponents';

function App() {
    return (
        <Container>
            <Header>Welcome to "TechnoSystems"</Header>
            <Text>We offer innovative solutions for business automation. Learn how our technology can help your business operate more efficiently!</Text>

            <Slider>
                <img src="/images/1.png" alt="Slide 1" />
                <img src="/images/2.jpg" alt="Slide 2" />
                <img src="/images/3.jpg" alt="Slide 3" />
            </Slider>

            <Button href="/services">Our Services</Button>
        </Container>
    );
}

export default App;
